  const LandButton = () => {
    const [showResults, setShowResults] = React.useState(false)
    const onClick = () => setShowResults(true)
    return (
      <div>
        <input type='submit' value='Land' onClick={onClick} />
        {showResults ? <LandResults /> : null}
      </div>
    )
  }

  const LandResults = () => (
    <Container>
      <Button
        className='RentButton'
        variant='warning'
        onClick={() => {
          newPage('land/rent')
        }}
      >
        Rent
      </Button>
      <Button
        className='BookingButton'
        variant='warning'
        onClick={() => {
          newPage('land/selling')
        }}
      >
        Buy
      </Button>
    </Container>
  )

  return (
    <Container className='PageStyle'>
      <Row>
        <Col>
          <h1>LAND AND BUILDING</h1>
          <h5>Find you best offer for you with our service</h5>
        </Col>
        <Col>
          <BuildingButton />
          <LandButton />
        </Col>
      </Row>
      <Row>
        <h1> Our benefites... ... ... ... ...</h1>
      </Row>
    </Container>
  )
}

export default HomePage
